import React from "react";
import {
  SidebarContainer,
  ExitButton,
  Slideshow,
  SidebarContent,
} from "./styles";

const Sidebar = ({ closeSidebar, project }) => {
  console.log(project.properties);
  return (
    <SidebarContainer>
      <ExitButton onClick={closeSidebar}>Close</ExitButton>
      <Slideshow />
      <SidebarContent project={project} />
    </SidebarContainer>
  );
};

export default Sidebar;
